Typically, you will see at the top of a source file (or even at the top of header files) something that looks like this: #include <iostream>
#include "rev.hh" What include directives do is copy the contents of the specified header file to their location, but you don't need to know the exact mechanics to understand what it does. The real purpose of this is that it enables a file that includes a header to access anything that the specified header declares. There are 2 main types of include directives. A system header directive is usually used to include something from the standard library, which is a core part of the C++ language. These files are not found in your include directory, but rather wherever your chosen compiler on your chosen operating system stores them. For example, if you include iostream, you get to use cout to print to the terminal. /* src/main.cc */ #include <iostream> int main() { std::cout << "Hello world!" << std::endl;
} prints Hello World! A file header, on the other hand, is usually used to include a header from your own project, or from a library you are using. For example, /* include/foo.hh */
/* Note: this file contains a terrible practice that is defining a function in a header. More on this later. */ #include <iostream> void print_hello_world() { std::cout << "Hello world!" << std::endl;
} alongside /* src/main.cc */ #include "foo.hh" int main() { print_hello_world();
} will print Hello World!
